import React from 'react';
import './App.css';
import  Machinebox from './components/Machinebox';


// Componentes HTML
const titulo = 'Maquinator:'




const data = [
  // ponemos column en vez de Row, pk cuando se carga  lo hace de arriba a bajo.
  { column0: "Ø10,7",       column1: "3820",            column2: "3825",          column3: "3824",             column4: "-" ,                  column5: "3821",         column6: "3823",        column7: "-",              column8: "3829" ,      column9: "3822",       foto:"1"},
  { column0: "Ø12",         column1: "NR-535",        column2: "NR-541",      column3: "NR 534",         column4: "NR 537" ,        column5: "NR-538",    column6: "-",               column7: "-",              column8: "-" ,            column9: "NR 540",   foto:"1"},
  { column0: "Ø12,7",       column1: "3720",            column2: "3725",          column3: "3724",             column4: "-" ,                  column5: "3721",         column6: "3723",        column7: "-",              column8: "3729" ,      column9: "3722",      foto:"1"},
  { column0: "Ø15",         column1: "NR-550",        column2: "NR 620",      column3: "NR 548",          column4: "NR 552" ,       column5: "NR-554",    column6: "NR 559",    column7: "NR 563",     column8: "NR 605" , column9: "NR 557",    foto:"1"},
  { column0: "Ø19",         column1: "NR-567",        column2: "NR 574",      column3: "NR 566",          column4: "NR 569" ,       column5: "NR-570",    column6: "NR 573",     column7: "NR 577",     column8: "-" ,          column9: "NR 572",    foto:"1"}

]






function App() {
  return (
    <div className="App">
      <h1> {titulo} </h1>

      <div className="table">
        <table>
          <tr>         
            <th>Valores</th>
            <th><img src={require('./img/electrodos/1.png')} alt="Logo" /> </th>
            <th><img src={require('./img/electrodos/2.png')} alt="Logo" /> </th>
            <th><img src={require('./img/electrodos/3.png')} alt="Logo" /> </th>
            <th><img src={require('./img/electrodos/4.png')} alt="Logo" /> </th>
            <th><img src={require('./img/electrodos/5.png')} alt="Logo" /> </th>
            <th><img src={require('./img/electrodos/6.png')} alt="Logo" /> </th>
            <th><img src={require('./img/electrodos/7.png')} alt="Logo" /> </th>
            <th><img src={require('./img/electrodos/8.png')} alt="Logo" /> </th>
            <th><img src={require('./img/electrodos/9.png')} alt="Logo" /> </th>
          </tr>

          {data.map((val, key) => {
            return ( 
              <tr key={key}>
                <td>{val.column0}</td>
                <td>{val.column1}</td>
                <td>{val.column2}</td>
                <td>{val.column3}</td>
                <td>{val.column4}</td>
                <td>{val.column5}</td>
                <td>{val.column6}</td>
                <td>{val.column7}</td>
                <td>{val.column8}</td>
                <td><Machinebox ruta={val.column9}/></td>

              </tr>

            )
          })}
        </table> 
      </div>
      <h1>Zona de pruebas</h1>

    </div>
  );
}

export default App;
